import React from 'react';

const Navigation = () => {

    const links = [
        { url: '/', title: 'О нас' },
        { url: '/about', title: 'Контакты' }
    ]

    return (
        <nav class="flex z-50 h-[50px] fixed top-0 left-0 right-0 bg-gray-900 text-white px-4 items-center justify-between">
            <h2 class="text-lg font-bold">СамГТУ</h2>

            <ul class="list-none flex">
                {
                    links.map((link) => (
                        <li class="mr-4"><a href={link.url}>{link.title}</a></li>
                    ))
                }

            </ul>
        </nav>
    );
}

export default Navigation;
